    public static Map traverseMap(String s) {
        char[] ch = s.toCharArray();
        Arrays.sort(ch);
        Map<Character, Integer> mp = new HashMap<>();
        for (int i = 0; i < ch.length; i++) {
            if (mp.containsKey(ch[i])) {
                int len = mp.get(ch[i]);
                mp.put(ch[i], ++len);
            } else {
                mp.put(ch[i], 1);
            }
        }
        return mp;
    }

