    public static boolean isPalindrome(String s) {
        boolean flag = false;
        if (s.length() == 0) {
            flag = true;
            return flag;
        }

        String nw = s.toLowerCase().replaceAll("[^a-zA-Z0-9]", "");
        System.out.println(nw);
        char[] ch = nw.toCharArray();
        int j = 0;
        for (int i = ch.length - 1; i >= 0; i--) {
            if (!(nw.charAt(j) == ch[i])) {
                flag = false;
                return flag;
            }
            j++;
        }
        flag = true;
        return flag;
    }

